import React from "react";
import Card from "./Card";
import contacts from "./contacts.js";

function App(){
    return
        <Card
            name= {contacts.name}
            image= {contacts.imgURL}
            tel={contacts.phone}
            email={contacts.email}
            />
   
}

export default App;
